  `adv_publish_time` datetime NOT NULL COMMENT '发布时间',
  PRIMARY KEY (`adv_no`),
  KEY `ind_adv_name` (`adv_name`),
  KEY `ind_adv_type` (`adv_type`)
) ENGINE=InnoDB AUTO_INCREMENT=1308 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

