  `ad_member_bank_account` varchar(40) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '银行户名',
  `ad_member_bank_number` varchar(40) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '银行账号',
  `ad_member_type` varchar(1) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '0:对公用户;1:对私用户',
  `ad_member_level` tinyint(4) DEFAULT '0' COMMENT '0无，1CPA用户，2CPS用户，3CPAS用户',
  `ad_member_sub_bank` varchar(46) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '开户支行名称',
  `ad_member_prove1` varchar(130) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证',
  `ad_member_prove2` varchar(130) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '营业执照',
